@namespace url(http://www.w3.org/1999/xhtml) !important;

@-moz-document domain("donbaleh.com") {

.comment{
	border:1px #c6c6c6 solid !important;
	margin-bottom: 10px !important;
	line-height: 20px !important;
}
.comment-top{
	border-bottom:1px #c6c6c6 solid !important;
	overflow:hidden !important;
	background:url("data:image/gif !important;base64,R0lGODlhAQAZALMAAAAAAP////Pz8/Ly8vHx8fDw8O/v7+7u7u3t7ezs7Ovr6+rq6unp6ejo6Ofn5////yH5BAEAAA8ALAAAAAABABkAAAQR0DXGllIJoXOMKQVBDINgmhEAOw==") repeat-x !important;
}
.comment-bd{
	background:url("data:image/gif !important;base64,R0lGODlhAQAHALMAAAAAAP////r6+vj4+Pb29vX19fPz8/Hx8fDw8P///wAAAAAAAAAAAAAAAAAAAAAAACH5BAEAAAkALAAAAAABAAcAAAQGEB1TyBARADs=") repeat-x !important;
	padding: 5px !important;
	font-size:11px !important;
}
.cmnt_agree{
	background: url("data:image/gif !important;base64,") left top !important;
}
.cmnt_agree:hover{
	background: url("data:image/gif !important;base64,") left bottom !important;
}
.cmnt_point{
	background: #fff !important;
	text-align: center !important;
	font-size: 11px !important;
	direction: ltr !important;
	vertical-align: middle !important;
	border-right: 1px #c6c6c6 solid !important;
}
.cmnt_disagree{
	background: url("data:image/gif !important;base64,") -26px top !important;
}
.cmnt_disagree:hover{
	background: url("data:image/gif !important;base64,") -26px bottom !important;
}
.cmnt_quote{
	background: url("data:image/gif !important;base64,") right top !important;
}
.cmnt_quote:hover{
	background: url("data:image/gif !important;base64,") right bottom !important;
}
.cmnt_del{
	background: url("data:image/gif !important;base64,") -78px top !important;
}
.cmnt_del:hover{
	background: url("data:image/gif !important;base64,") -78px bottom !important;
}
.cmnt_edit{
	background: url("data:image/gif !important;base64,") -52px top !important;
}
.cmnt_edit:hover{
	background: url("data:image/gif !important;base64,") -52px bottom !important;
}
.panel{
	margin-bottom:15px !important;
	border: 1px solid #c8c8c8 !important;
}
.panel_top {
	background: url("data:image/gif !important;base64,R0lGODlhAQBUAMQAAAAAAP////H5//D5//P6/+j2//L6/+/5//H6//v7+/r6+vj4+O3t7ezs7Ovr6+rq6unp6ejo6N3d3f///wAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACH5BAEAABMALAAAAAABAFQAAAUoIEEYpIEggjCsx1G8cAwndG0nSq4sfO/3DEZj6HA8jhBIZClpOp/OEAA7") repeat-x bottom left !important;
	border-bottom:1px solid #d8d8d8 !important;
	padding: 0 7px 0 0 !important;
	height:28px !important;
	text-align:right !important;
}
.panel_top span{
	padding: 6px 7px 5px 0 !important;
	direction: rtl !important;
	float:right !important;
}
.dpanel{
	 margin-bottom:15px !important;
	 border:1px solid #c8c8c8 !important;
	 border-top:none !important;
}
.dpanel_top{
	background: url("data:image/gif !important;base64,R0lGODlhAQBUAMQAAAAAAP////H5//D5//P6/+j2//L6/+/5//H6//v7+/r6+vj4+O3t7ezs7Ovr6+rq6unp6ejo6N3d3f///wAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACH5BAEAABMALAAAAAABAFQAAAUoIEEYpIEggjCsx1G8cAwndG0nSq4sfO/3DEZj6HA8jhBIZClpOp/OEAA7") repeat-x bottom left !important;
	border-top:1px solid #c8c8c8 !important;
	border-bottom:1px solid #c8c8c8 !important;
	padding-top: 7px !important;
	height:20px !important;
	text-align:center !important;
	float: left !important;
	width: 129px !important;
	cursor: pointer !important;
	font-size: 8pt !important;
}
.dpanel_top:hover{
	background: url("data:image/gif !important;base64,R0lGODlhAQBUAMQAAAAAAP////H5//D5//P6/+j2//L6/+/5//H6//v7+/r6+vj4+O3t7ezs7Ovr6+rq6unp6ejo6N3d3f///wAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACH5BAEAABMALAAAAAABAFQAAAUoIEEYpIEggjCsx1G8cAwndG0nSq4sfO/3DEZj6HA8jhBIZClpOp/OEAA7") repeat-x top left !important;
}
.PanelSelected{
	background: url("data:image/gif !important;base64,R0lGODlhAQBUAMQAAAAAAP////H5//D5//P6/+j2//L6/+/5//H6//v7+/r6+vj4+O3t7ezs7Ovr6+rq6unp6ejo6N3d3f///wAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACH5BAEAABMALAAAAAABAFQAAAUoIEEYpIEggjCsx1G8cAwndG0nSq4sfO/3DEZj6HA8jhBIZClpOp/OEAA7") repeat-x center left !important;
	border-top:1px solid #c8c8c8 !important;
	border-bottom:1px solid #fff2f2 !important;
	padding-top: 7px !important;
	height:20px !important;
	text-align:center !important;
	float: left !important;
	width: 129px !important;
	font-size: 8pt !important;
	cursor: default !important;
}
.dpanel_sep{
	width: 6px !important;
	border:1px solid #c8c8c8 !important;
	border-top: none !important;
	height: 28px !important;
	float: left !important;
}
.panel_mid {
	background: #f8f8f8 !important;
	border-top: none !important;
	direction: rtl !important;
	padding: 10px 10px !important;
}
.panel_bot {
	border-top: 1px solid #d8d8d8 !important;
	background: #f1f1f1 !important;
	height: 28px !important;
}
.info{
	border: 1px #c8c8c8 solid !important;
	background: #f8f8f8 !important;
	margin-bottom:10px !important;
	padding:5px 10px !important;
	direction:rtl !important;
	line-height:20px !important;
	text-align:justify !important;
	font-size:11px !important;
	color: #5e5e5e !important;
}
.userAward{
	border:1px solid #c8c8c8 !important;
	background: #f8f8f8 url("data:image/png !important;base64,") no-repeat 245px 6px !important;
	padding: 7px 30px 7px 0 !important;
	margin-bottom: 15px !important;
	direction: rtl !important;
}
#sep {
	width: 14px !important;
	cursor: pointer !important;
	background: url("data:image/gif !important;base64,") repeat-y 0 0 !important;
}
#sep:hover{
	background: url("data:image/gif !important;base64,") repeat-y right top !important;
}
.forumPost{
	background: url("data:image/gif !important;base64,R0lGODlhAQAlALMAAAAAAP////r6+vn5+fj4+Pf39/b29u/v7////wAAAAAAAAAAAAAAAAAAAAAAAAAAACH5BAEAAAgALAAAAAABACUAAAQQcAxCabnXmMO7R9pVSYMgRAA7") repeat-x 0 0 !important;
	height:24px !important;
	line-height:24px !important;
	padding:0 5px !important;
	border:1px solid #c9c9c9 !important;
}

}
